import React from "react";

interface MainHeaderProps {
  num: number;
}
function MainHeader(props: MainHeaderProps) {
  return (
    <div className="mainHeader">
      <div className="gancxadeba">{props.num} განცხადება</div>
      <select className="time">
        <option value="1">1 საათი</option>
        <option value="2">2 საათი</option>
        <option value="3">3 საათი</option>
        <option value="24">1 დღე</option>
        <option value="48">2 დღე</option>
        <option value="72">3 დღე</option>
      </select>
      <select className="filterMethod">
        <option value="option1">თარიღი კლებადი</option>
        <option value="option2">თარიღი ზრდადი</option>
        <option value="option3">ფასი კლებადი</option>
        <option value="option4">ფასი ზრდადი</option>
        <option value="option5">გარბენი კლებადი</option>
        <option value="option6">გარბენი ზრდადი</option>
      </select>
    </div>
  );
}

export default MainHeader;
